import React from 'react';

export default class Input extends React.Component {
    render(){
        return(
            <input type={this.props.type} value={this.props.value} 
                onChange={() => {
                    alert(this.value);
                    this.props.set(this.value, this.props.typeInput)
                }} 
            />
        );
    }
}
